import React from "react";
import { Container, Row, Col, Card } from "react-bootstrap";
import a from "./img/a.jpg";
import b from "./img/b.jpg";
import c from "./img/c.jpg";

function Cards(props){
    return (
            <Col>
            <Card>
                <img className="card-img" src={props.image} alt="images" />

                </Card>
            </Col>
    )
}

const Portfolio = () => {
    return (
        <div style={{paddingTop: "200pt", paddingBottom: "200pt"}}>
        <Container>
            <Row>
                <Cards header="Yo" para="fdfdsfdsfsfsdfsdfsf" image={a} />
                <Cards header="yoo" para="sdfdsfsfs" image={b} />
                <Cards header="fdsfsf" para="fdsfsf" image={c} />
            </Row>
        </Container>
        </div> 
     );
}

export default Portfolio;
